import React from 'react';
import BulletDescription from './BulletDescription';
import timeline from '../images/timeline.png';

const ExperienceIndi = props => {
  return (
    <div className="experience-indi">
      <div className="left">
        <div className="left-container">
          <h3>{props.year}</h3>
          <h4>{props.months}</h4>
          <img
            className="timeline"
            src={timeline}
            alt="timeline"
            height="400px"
          />
        </div>
      </div>
      <div className="right">
        <img
          className="logo"
          src={props.logo}
          alt={props.company + 'logo'}
          width="150px"
          height="150px"
        />
        <div className="content">
          <h2 className="title">{props.role}</h2>
          <h2 className="company"> &nbsp;@ {props.company}</h2>
          {/* <h5 className="location"> {props.location}</h5> */}
          {/* <BulletDescription descriptions={props.descriptions} /> */}
        </div>
      </div>
    </div>
  );
};

export default ExperienceIndi;
